10 2013


10 is the sixth studio album by New Kids on the Block, it was released on April 2, 2013. This is the band's first studio album since 2008's The Block, as well as their first album released independently after departing from Interscope Records. The album title refers to it being their tenth album release in the US (including compilation albums).[1] The album made its debut on the Billboard 200 at number 6 and number 1 on the Top Independent Albums.


On January 22, 2013, the group appeared on The View and announced that they were going to release a new single titled &quot;Remix (I Like The)&quot; on January 28 and a new album titled 10 would be released on April 2, 2013. During the show, they also announced that they were going to tour with 98 Degrees and Boyz II Men as their opening acts in summer 2013.[2] On February 6, the band released the official track listing for the album's standard edition on their official website. They released the second single, &quot;The Whisper&quot; on August 1, 2013. The video features footage from their recently-ended The Package Tour.


